void convertTo16Bit(uint8_t image8[], short int image16[]) {
  for (int i = 0; i < X_RESOLUTION * Y_RESOLUTION * 2; i++) {
    image16[i / 2] =
        (image8[i] << 8) |
        image8[i + 1];  // concatenate two 8 bits entries for RGB565
  }
}

